import React, { useState, useEffect } from "react";
import "./Players.css";

const Players = () => {
  const [players, setPlayers] = useState([]); // Tüm oyuncuları tutar
  const [currentPage, setCurrentPage] = useState(1); // Mevcut sayfa
  const playersPerPage = 100; // Sayfa başına oyuncu sayısı

  // Verileri simüle etme
  useEffect(() => {
    // Simulated players data
    const data = Array.from({ length: 8000 }, (_, i) => ({
      id: i + 1,
      name: `Player ${i + 1}`,
      club: `Club ${i % 20}`,
      nationality: `Country ${i % 10}`,
      position: ["GK", "DC", "MC", "ST"][i % 4],
      rating: Math.floor(Math.random() * 10) + 80,
      contractUntil: "06-2025",
      wage: `${Math.floor(Math.random() * 400) + 50}K p/w`,
      image: i % 7 === 0 ? null : `https://via.placeholder.com/50?text=P${i + 1}`, // Bazı oyuncularda foto yok
    }));
    setPlayers(data);
  }, []);

  // Sayfa başı oyuncular
  const indexOfLastPlayer = currentPage * playersPerPage;
  const indexOfFirstPlayer = indexOfLastPlayer - playersPerPage;
  const currentPlayers = players.slice(indexOfFirstPlayer, indexOfLastPlayer);

  // Sayfa değiştirme işlemi
  const paginate = (pageNumber) => setCurrentPage(pageNumber);

  // Toplam sayfa sayısı
  const totalPages = Math.ceil(players.length / playersPerPage);

  return (
    <div className="players-page">
      {/* Sidebar */}
      <aside className="players-sidebar">
        <h2>Filters</h2>
        <div className="filter-group">
          <label>Name</label>
          <input type="text" placeholder="Name" />
        </div>
        <div className="filter-group">
          <label>Club</label>
          <input type="text" placeholder="Club" />
        </div>
        <div className="filter-group">
          <label>Nationality</label>
          <input type="text" placeholder="Nationality" />
        </div>
        <div className="filter-group">
          <label>League</label>
          <input type="text" placeholder="League" />
        </div>
      </aside>

      {/* Main content */}
      <main className="players-list">
        <h1>Players</h1>
        <table>
          <thead>
            <tr>
              <th>Photo</th>
              <th>Name</th>
              <th>Club</th>
              <th>Position</th>
              <th>Rating</th>
              <th>Wage</th>
              <th>Contract</th>
            </tr>
          </thead>
          <tbody>
            {currentPlayers.map((player) => (
              <tr key={player.id}>
                <td>
                  {player.image ? (
                    <img
                      src={player.image}
                      alt={player.name}
                      className="player-photo"
                    />
                  ) : (
                    <div className="placeholder-photo">No Image</div>
                  )}
                </td>
                <td>{player.name}</td>
                <td>{player.club}</td>
                <td>{player.position}</td>
                <td>{player.rating}</td>
                <td>{player.wage}</td>
                <td>{player.contractUntil}</td>
              </tr>
            ))}
          </tbody>
        </table>

        {/* Pagination */}
        <div className="pagination">
          {Array.from({ length: totalPages }, (_, i) => (
            <button
              key={i + 1}
              className={`pagination-btn ${
                currentPage === i + 1 ? "active" : ""
              }`}
              onClick={() => paginate(i + 1)}
            >
              {i + 1}
            </button>
          ))}
        </div>
      </main>
    </div>
  );
};

export default Players;
